import { AccountBalance, LogoDev, LogoDevOutlined } from "@mui/icons-material";
import {
  AppBar,
  Button,
  IconButton,
  Menu,
  MenuItem,
  TextField,
  Toolbar,
  Typography,
} from "@mui/material";
import React, { useState } from "react";
import userIcon from "../../assets/icon/user.svg";
import shoppingBag from "../../assets/icon/shopping-bag.svg";
import heart from "../../assets/icon/heart.svg";
import carretDown from "../../assets/icon/carret - down.svg";

function DashboardPage() {
  const [anchorEl, setAnchorEl] = useState(null);

  const handleMenuOpen = (event) => {
    setAnchorEl(event.currentTarget);
  };

  const handleMenuClose = () => {
    setAnchorEl(null);
  };
  return (
    <div>
      <AppBar
        position="static"
        elevation={0}
        style={{ backgroundColor: "#FFF", color: "#000" }}
      >
        <Toolbar>
          <Typography variant="h6" sx={{ flexGrow: 1 }}></Typography>
          <div style={{ display: "flex", columnGap: "25px" }}>
            <div>
              <TextField
                label="Nama Depan"
                variant="outlined"
                fullWidth
                margin="normal"
              />
            </div>
            <div>
              <img src={heart} alt="heart" />
            </div>
            <div>
              <img src={shoppingBag} alt="shopping bag" />
            </div>
            <div onClick={handleMenuOpen} style={{ cursor: "pointer" }}>
              <img src={userIcon} alt="user" />
              <img src={carretDown} alt="carret" />
            </div>
          </div>
          <Menu
            anchorEl={anchorEl}
            open={Boolean(anchorEl)}
            onClose={handleMenuClose}
            anchorOrigin={{
              vertical: "top",
              horizontal: "right",
            }}
            transformOrigin={{
              vertical: "top",
              horizontal: "right",
            }}
          >
            <MenuItem onClick={handleMenuClose}>Profile</MenuItem>
            <MenuItem onClick={handleMenuClose}>Logout</MenuItem>
          </Menu>
        </Toolbar>
      </AppBar>
    </div>
  );
}

export default DashboardPage;
